function RSAKeyPair(i,r,t){this.e=biFromHex(i);this.d=biFromHex(r);this.m=biFromHex(t);this.chunkSize=2*biHighIndex(this.m);this.radix=16;this.barrett=new BarrettMu(this.m)}function twoDigit(i){return(i<10?"0":"")+String(i)}function encryptedString(i,r){var t=new Array;var e=r.length;var n=0;while(n<e){t[n]=r.charCodeAt(n);n++}while(t.length%i.chunkSize!=0){t[n++]=0}var a=t.length;var h="";var o,g,d;for(n=0;n<a;n+=i.chunkSize){d=new BigInt;o=0;for(g=n;g<n+i.chunkSize;++o){d.digits[o]=t[g++];d.digits[o]+=t[g++]<<8}var s=i.barrett.powMod(d,i.e);var b=i.radix==16?biToHex(s):biToString(s,i.radix);h+=b+" "}return h.substring(0,h.length-1)}function decryptedString(i,r){var t=r.split(" ");var e="";var n,a,h;for(n=0;n<t.length;++n){var o;if(i.radix==16){o=biFromHex(t[n])}else{o=biFromString(t[n],i.radix)}h=i.barrett.powMod(o,i.d);for(a=0;a<=biHighIndex(h);++a){e+=String.fromCharCode(h.digits[a]&255,h.digits[a]>>8)}}if(e.charCodeAt(e.length-1)==0){e=e.substring(0,e.length-1)}return e}